import "./Footer.css";

function Footer() {
  return (
    <div className="footer">
      <iframe
        className="a"
        src="https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d13501.434698055142!2d34.9795485!3d32.2215076!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x151d3c61af26d54b%3A0xb9846a49b7f26f74!2z15vXpNeZ16gg16nXmdeV15XXpyDXkNeo15nXlteV16og15HXoiLXng!5e0!3m2!1siw!2sil!4v1678289147023!5m2!1siw!2sil"
      />
    </div>
  );
}

export default Footer;
